import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({ question,index }){


    console.log(question);
    return(

        <Paper
            key={index}
        >
            <h3>Category</h3>
            <p>{question.category}</p>
        </Paper>
    )
}


export default Question;
